import React from "react";

export default function Signup() {
  return (
    <div className='sign-up'>
      <form>
        <label>Email</label>
        <input type='email' placeholder='Your email address'></input>
        <input type='submit'>Sign Up</input>
      </form>
    </div>
  );
}
